import React from 'react';
import withStyles from '../../hoc/withStyles';
import FooterStyles from './Footer.style';
import BodyCopy from '../../atoms/BodyCopy/BodyCopy';
import LABELS from '../../../constants/labels';
import Link from 'next/link';

const Footer = (props, nextPage) => {
    const {className, page} = props;
    return(
        <div className={className}>

        <footer>
        {nextPage && (
          <Link href={`/?page=${page + 1}`}>
           <BodyCopy component="span" className="nav-item"><a>{LABELS.NEXT_PAGE} ({page + 1})</a>}</BodyCopy>
            </Link>
        )}





        </footer>
        </div>
    )
}

export default withStyles(Footer,FooterStyles);
